import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import CreateUserView from "../views/CreateUserView";
import Error404View from "../views/Error404View";
import LoginView from "../views/LoginView";
import UsersView from "../views/UsersView";

const AppRouter = () => {
  let loginAccess = localStorage.getItem('token')
  return (
    <Router>
      <Switch>
        <Route exact path="/" component={LoginView}></Route>
        <Route exact path="/ingreso" component={LoginView}>{
          loginAccess
}</Route>
        <Route exact path="/usuarios" component={UsersView}></Route>
        <Route exact path="/crear" component={CreateUserView}></Route>
        <Route path="*" component={Error404View}></Route>
      </Switch>
    </Router>
  );
};

export default AppRouter;
